INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (502, 'Urban planning documentation', false, 'front.service_card_urban_planning_text', 'Шаҳарсозлик ҳужжатларини давлат экологик экспертизасидан ўтказиш', 'Градостроительная документация', 'Shaharsozlik hujjatlarini davlat ekologik ekspertizasidan o’tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (501, 'Materials of a comprehensive survey of territories in order to subsequently give them the status of protected natural areas, zones of environmental emergency and environmental disaster', false, 'front.service_card_regions_text', 'Ҳудудларга кейинчалик муҳофаза қилинадиган табиий ҳудудлар, фавқулодда экологик вазият ва экологик офат зоналари мақомини бериш мақсадида уларни комплекс текшириш материалларини давлат экологик экспертизасидан ўтказиш', 'Материалы комплексного обследования территорий в целях последующего придания им статуса охраняемых природных территорий, зон чрезвычайной экологической ситуации и экологического бедствия', 'Hududlarga keyinchalik muhofaza qilinadigan tabiiy hududlar, favqulodda ekologik vaziyat va ekologik ofat zonalari maqomini berish maqsadida ularni kompleks tekshirish materiallarini davlat ekologik ekspertizasidan o’tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (500, 'Existing enterprises and other facilities that have a negative impact on the state of the environment and the health of citizens', false, 'front.service_card_environment_text', 'Атроф табиий муҳитга ва фуқароларнинг соғиғига салбий таъсир кўрсатувчи ишлаб турган корхоналар ва бошқа объектларни давлат экологик экспертизасидан ўтказиш', 'Действующие предприятия и другие объекты, оказывающие негативное влияние на состояние окружающей природной среды и здоровье граждан', 'Atrof tabiiy muhitga va fuqarolarning sog''lig''iga salbiy ta''sir ko''rsatuvchi ishlab turgan korxonalar va boshqa ob''yektlarni davlat ekologik ekspertizasidan o’tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (499, 'Documentation on the creation of new types of equipment, technologies, materials, substances, products', false, 'front.service_card_technique_text', 'Техника, технология, материаллар, моддалар, маҳсулотларнинг янги турларини яратишга доир ҳужжатларни давлат экологик экспертизасидан ўтказиш', 'Документация по созданию новых видов техники, технологий, материалов, веществ, продукции', 'Texnika, texnologiya, materiallar, moddalar, mahsulotlarning yangi turlarini yaratishga doir hujjatlarni davlat ekologik ekspertizasidan o’tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (498, 'Draft regulatory and technical and instructional documents governing economic and other activities related to the use of natural resources', false, 'front.service_card_natural_resources_text', 'Табиий ресурслардан фойдаланиш билан боғлиқ хўжалик ва бошқа фаолиятни тартибга солувчи норматив-техник ва йўриқнома-услубий ҳужжатларнинг лойиҳаларини давлат экологик экспертизасидан ўтказиш', 'Проекты нормативно-технических и инструктивно-методических документов, регламентирующих хозяйственную и иную деятельность, связанную с использованием природных ресурсов', 'Tabiiy resurslardan foydalanish bilan bog''liq xo''jalik va boshqa faoliyatni tartibga soluvchi normativ-texnik va yo''riqnoma-uslubiy hujjatlarning loyihalarini davlat ekologik ekspertizasidan o''tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (497, 'Pre-project and project documentation by type of activity', false, 'front.service_card_activities_text', 'Фаолият турлари бўйича лойиҳаолди ва лойиҳа ҳужжатларини давлат экологик экспертизасидан ўтказиш', 'Предпроектная и проектная документация по видам деятельности', 'Faoliyat turlari bo''yicha loyihaoldi va loyiha hujjatlarini davlat ekologik ekspertizasidan o''tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (496, 'Materials for the selection of land for all types of construction', false, 'front.service_card_all_kinds_text', 'Барча турдаги қурилиш учун ер участкаларини танлаш материалларини давлат экологик экспертизасидан ўтказиш', 'Материалы выбора земельных участков под все виды строительства', 'Barcha turdagi qurilish uchun yer uchastkalarini tanlash materiallarini davlat ekologik ekspertizasidan o''tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (495, 'Projects of concepts, patterns of placement and development of productive forces, sectors of the economy', false, 'front.service_card_working_text', 'Ишлаб чиқариш кучлари, иқтисодиёт тармоқларини жойлаштириш ва ривожлантириш концепциялари, схемаларининг лойиҳаларини давлат экологик экспертизасидан ўтказиш', 'Проекты концепций, схем размещения и развития производительных сил, отраслей экономики', 'Ishlab chiqarish kuchlari, iqtisodiyot tarmoqlarini joylashtirish va rivojlantirish konsepsiyalari, sxemalarining loyihalarini davlat ekologik ekspertizasidan o''tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (494, 'Drafts of state programs, concepts and schemes for the development of the social sphere, as well as management plans for state protected natural areas', false, 'front.service_card_social_text', 'Ижтимоий соҳани, ривожлантириш давлат дастурлари, концепциялари ва схемаларининг, шунингдек, давлат томонидан муҳофаза этиладиган табиий ҳудудларни бошқариш режаларининг лойиҳаларини давлат экологик экспертизасидан ўтказиш', 'Проекты государственных программ, концепций и схем развития социальной сферы, а также планов управления государственных охраняемых природных территорий', 'Ijtimoiy sohani, rivojlantirish davlat dasturlari, konsepsiyalari va sxemalarining, shuningdek, davlat tomonidan muhofaza etiladigan tabiiy hududlarni boshqarish rejalarining loyihalarini davlat ekologik ekspertizasidan o''tkazish');
INSERT INTO public.sys_translation (id, english, is_html, name, ozbek, russian, uzbek) VALUES (493, 'List of interactive services used through the portal', false, 'front.service-subtitle', 'Портал орқали фойдаланиладиган интерактив хизматлар рўйхати', 'Список интерактивных услуг использующиеся посредством портала', 'Portal orqali foydalaniladigan interaktiv xizmatlar ro''yxati');
